import React from "react";

export const Headers = () => {
  return (
    <div className="flex ">
          <h1
            className="m-2 max-w-lg text-2xl font-bold text-center md:text-4xl md:text-left sm:m-10 "
          >
            The Logo
          </h1>
      <ul className="list-disc list-inside flex bg-black">
        <li>Home</li>
        <li>Two</li>
        <li>Three</li>
      </ul>
    </div>
  );
};
